Un missile est un projectile autopropulsé et guidé (sinon c'est une roquette), constitué de : 
*  un propulseur : moteur-fusée, réacteur (généralement statoréacteur), voire les deux (une fusée donnant l'impulsion de départ, avant d'être relayée par un statoréacteur) ; 
*  un système de guidage, qu'il soit externe (téléguidage) ou indépendant (autoguidage) ; 
*  une charge utile, qui peut être une charge militaire (explosive, incendiaire, chimique, biologique, etc), un système électronique (drone de reconnaissance, missile scientifique ou expérimental) voire un simple poids pour équilibrer l'engin (missile cible) ou une masse inerte (missile de propagande transportant des tracts). Le terme missile désignait initialement un projectile quel qu'il soit. Toujours existante en anglais, cette acception est aujourd'hui obsolète en français. On peut la trouver dans des ouvrages datant d'entre les deux guerres mondiales. La règle généralement utilisée de nos jours veut que : 
*  les engins possédant un guidage soient nommés missiles, quel que soit le système de propulsion ; 
*  les engins propulsés par un autre moyen qu'une fusée à poudre soient nommés missiles. À part quelques prototypes datant des environs de la Seconde Guerre mondiale, tous ces engins ont un système de guidage ; 
*  les fusées à poudre sans guidage soient nommées roquettes (de rocket, fusée en anglais) ; 
*  les projectiles (guidés ou non) se déplaçant sous la surface de l'eau soient nommés torpilles. Il existe cependant des exceptions, tels que les projectiles des lance-roquettes multiples, qui sont actuellement le plus souvent autoguidés tout en conservant le nom de roquettes, ou des prototypes datant d'une période où les systèmes électroniques étaient bien plus coûteux, fragiles et volumineux qu'actuellement. Une telle utilisation de ce terme est exceptionnelle et, en général, due à un contexte historique particulier (prototype ancien, dénomination qui perdure bien qu'elle soit devenue impropre).
